import React from 'react'
import LandingInfo from '../components/Landing/LadingInfo'
import LandingImage from '../components/Landing/LandingImage'

function Landing(params) {
  return (
    <div>
      <LandingImage />
      <LandingInfo />
    </div>
  )
}

export default Landing
